import './App.css';
import {
  BrowserRouter,
  Switch,
  Route,
  Link
} from "react-router-dom"
import AuthorList from './components/AuthorList';
import newAuthor from './components/newAuthor';

function App() {
  return (
    <BrowserRouter>
      <div className="App">
        <h1>Favorite authors</h1>
      </div>
      <Switch>
        <Route exact path="/">
          <div className="App">
          <p><Link to="/new" >Add Author</Link></p>
            <AuthorList></AuthorList>
          </div>
        </Route>
        <Route exact path="/new">
          <newAuthor></newAuthor>
        </Route>
        <Route exact path="/route2">

        </Route>
      </Switch>
    </BrowserRouter>
  );
}

export default App;
